import './Home.css';

function Home() {
  return (
    <div className="home">
      <div className="home-content">
        <h1>Bem-vindo à Taxi Micheline's</h1>
        <p>Alugue os melhores veículos para você ou sua empresa!</p>
        <button className="cta-button">Alugue Agora</button>
      </div>
    </div>
  );
}

export default Home;
